import CounterStore from './store/CounnterStore';
import { Provider } from 'mobx-react'; 

ReactDOM.render(
  <Provider counterSotre = { CounterStore}>
    <App />
  </Provider>,
  document.getElementById('root')
);

reportWebVitals();
